    "headlineNews": "Daniel Jones completed 17-of-22\u00a0passes for 135 yards, one touchdown, and one interception in the Giants' third preseason game against the Patriots.\n",
    "report": "",
    "analysis": "Jones started the night on rocky footing, taking a pair of sacks within his first two drives. Left tackle Andrew Thomas was a revolving door, allowing anyone who wanted to pressure Jones to do so, but Jones also held onto the ball too long at times. He also gifted the Patriots an interception while on their one-yard line. Jones saved an otherwise dreadful night with an impressive two-minute drill to close out the first half. He marched the New York offense down the field before delivering a perfectly-placed deep shot to tight end Kaden Smith for a touchdown. This type of erratic performance should be the norm for Jones in 2021. He\u2019s capable of making incredible throws but will do so after a handful of crippling mistakes. Jones will be a frustrating player to decipher for fantasy managers but will manage to post QB2 numbers through his rushing production.\n",
