    "report": "",
    "analysis": "Hines, according to beat writers and coaches, enters the regular season following the best training camp of his four-year career. The pass-catching specialist has been vocal about his desire to see more action in 2021. Keefer said the consensus among Indianapolis coaches this offseason was that they didn't give Hines enough snaps or touches in 2020, but that it would be difficult to increase his usage with Jonathan Taylor locked into the lead back role. Hines has\u00a0never seen more than 44 percent of the Colts\u2019 offensive snaps; he was on the field for 36 percent of the team's offensive snaps last year. He excelled when given the chance: Against the Titans in Week 11, he turned 17 touches into 155 yards and two scores with Taylor sidelined. Hines is a solid tenth round pick in 12-team PPR formats for drafters who fade early-down running backs.\u00a0\n",
